import './App.css';

function App() {
  return (
    <div className="app">
      <div className="app_header">
        <img className="app_headerimage"src="https://i.pinimg.com/564x/08/17/15/0817158f3a05c0d62de647c28f4cde54.jpg" alt="" />
      </div>
    </div>
  );
}

export default App;
